import React from 'react';

class LoginPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      login: this.props.login
    };
  }
  login = () => {
    this.setState({ login: true });
  };
  render() {
    return (
      <React.Fragment>
        UsersName:
        <input />
        Psssword:
        <input />
        <br />
        <button onClick={this.login}>Login</button>
      </React.Fragment>
    );
  }
}

export default LoginPage;
